  false,\n\t\"url\": null,\n\t\"notes\": \"The data in this dataset are monthly listings
  of the number of Temporary Assistance for Needy Families (TANF), Safety Net Assistance-Maintenance
  of Effort (SNA-MOE), and Safety Net Assistance Non-Maintenance of Effort (SNA Non-MOE)
  cash assistance cases with earned monthly income, and the average gross earned monthly
  income and average net earned monthly income (after applying earned income disregards)
  for these cases.  Data is presented by case type for each local social services
  district.  The dataset is from the NYS Office of Temporary and Disability Assistance
  (OTDA) and is updated monthly.\",\n\t\"owner_org\": \"198d9a94-80ac-4c81-bec3-5c7783455f9c\",\n\t\"extras\":
